-- Gaming Achievement System Database Analysis
-- This analysis helps determine when to use Window Functions vs JOINs
-- Based on data characteristics and relationship patterns

-- ================================================================
-- SECTION 1: OVERALL DATA VOLUME AND DISTRIBUTION
-- ================================================================

-- 1.1 Basic table sizes and growth patterns
SELECT 'Table Sizes Overview' as analysis_type;
SELECT
    'players' as table_name,
    COUNT(*) as total_records,
    COUNT(DISTINCT id) as unique_records,
    MIN(created_at) as earliest_record,
    MAX(created_at) as latest_record
FROM players
UNION ALL
SELECT
    'achievement_unlocks' as table_name,
    COUNT(*) as total_records,
    COUNT(DISTINCT id) as unique_records,
    MIN(created_at) as earliest_record,
    MAX(created_at) as latest_record
FROM achievement_unlocks
UNION ALL
SELECT
    'achievements' as table_name,
    COUNT(*) as total_records,
    COUNT(DISTINCT id) as unique_records,
    MIN(created_at) as earliest_record,
    MAX(created_at) as latest_record
FROM achievements
UNION ALL
SELECT
    'guilds' as table_name,
    COUNT(*) as total_records,
    COUNT(DISTINCT id) as unique_records,
    MIN(created_at) as earliest_record,
    MAX(created_at) as latest_record
FROM guilds;

