-- 2.2 Guild size buckets for performance correlation
SELECT 'Guild Size Buckets' as analysis_type;
SELECT
    CASE
        WHEN active_unlocks <= 1000 THEN 'Small (≤1K)'
        WHEN active_unlocks <= 10000 THEN 'Medium (1K-10K)'
        WHEN active_unlocks <= 100000 THEN 'Large (10K-100K)'
        WHEN active_unlocks <= 1000000 THEN 'Very Large (100K-1M)'
        ELSE 'Enterprise (>1M)'
    END as size_category,
    COUNT(*) as guild_count,
    MIN(active_unlocks) as min_unlocks,
    MAX(active_unlocks) as max_unlocks,
    ROUND(AVG(active_unlocks), 0) as avg_unlocks,
    ROUND(STDDEV(active_unlocks), 0) as stddev_unlocks
FROM (
    SELECT
        guild_id,
        COUNT(CASE WHEN deleted_at IS NULL THEN 1 END) as active_unlocks
    FROM achievement_unlocks
    GROUP BY guild_id
) guild_stats
GROUP BY
    CASE
        WHEN active_unlocks <= 1000 THEN 'Small (≤1K)'
        WHEN active_unlocks <= 10000 THEN 'Medium (1K-10K)'
        WHEN active_unlocks <= 100000 THEN 'Large (10K-100K)'
        WHEN active_unlocks <= 1000000 THEN 'Very Large (100K-1M)'
        ELSE 'Enterprise (>1M)'
    END
ORDER BY min_unlocks;

