-- 4.1 Games-Achievements relationship distribution
SELECT 'Games-Achievements Relationship Analysis' as analysis_type;
SELECT
    game_id,
    g.name as game_name,
    COUNT(DISTINCT ga.achievement_id) as achievements_count,
    COUNT(DISTINCT au.id) as total_unlocks,
    COUNT(DISTINCT au.player_id) as unique_players_attempted
FROM games g
LEFT JOIN games_achievements ga ON g.id = ga.game_id
LEFT JOIN achievement_unlocks au ON ga.achievement_id = au.achievement_id AND au.deleted_at IS NULL
GROUP BY game_id, g.name
ORDER BY achievements_count DESC;

