-- 4.2 Achievement popularity distribution (affects JOIN performance)
SELECT 'Achievement Popularity Analysis' as analysis_type;
SELECT
    achievement_id,
    a.name as achievement_name,
    COUNT(CASE WHEN au.deleted_at IS NULL THEN 1 END) as active_unlocks,
    COUNT(DISTINCT au.guild_id) as guilds_with_achievement,
    COUNT(DISTINCT au.player_id) as unique_players,
    ROUND(AVG(au.progress_percentage), 2) as avg_progress_percentage
FROM achievements a
LEFT JOIN achievement_unlocks au ON a.id = au.achievement_id
GROUP BY achievement_id, a.name
ORDER BY active_unlocks DESC;

