    progress_range,
    COUNT(*) as record_count,
    ROUND(COUNT(*) * 100.0 / SUM(COUNT(*)) OVER(), 2) as percentage
FROM (
    SELECT
        CASE
            WHEN progress_percentage IS NULL THEN 'NULL'
            WHEN progress_percentage = 0 THEN '0%'
            WHEN progress_percentage < 25 THEN '1-24%'
            WHEN progress_percentage < 50 THEN '25-49%'
            WHEN progress_percentage < 75 THEN '50-74%'
            WHEN progress_percentage < 100 THEN '75-99%'
            WHEN progress_percentage = 100 THEN '100%'
            ELSE 'Invalid'
        END as progress_range,
        CASE
            WHEN progress_percentage IS NULL THEN 0
            WHEN progress_percentage = 0 THEN 1
            WHEN progress_percentage < 25 THEN 2
            WHEN progress_percentage < 50 THEN 3
            WHEN progress_percentage < 75 THEN 4
            WHEN progress_percentage < 100 THEN 5
            WHEN progress_percentage = 100 THEN 6
            ELSE 7
        END as sort_order
    FROM achievement_unlocks
    WHERE deleted_at IS NULL
) progress_data
GROUP BY progress_range, sort_order
ORDER BY sort_order;

